import React, { Component } from "react";
import {BrowserRouter,Route,NavLink} from "react-router-dom"
import Footer from "./components/Footer";
import Content from "./components/Content";
import Jumbo from "./components/Jumbo";
import SiteNav from "./components/SiteNav";


import "./App.css";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
      <React.Fragment>
      <SiteNav></SiteNav> 
        <main role="main">
      <Jumbo></Jumbo>
          <div>
          <NavLink to="/Features">Go to Jumbo</NavLink>
          </div>
          <div>
            <Route path="/Features" exact={true} component={Jumbo}></Route>
          </div>
      <Content></Content>
          <div>
          <NavLink to="/Pricing">Go to Content</NavLink>
          </div>
          <div>
            <Route path="/Pricing" exact={true} component={Content}></Route>
          </div>
        </main>
      <Footer></Footer>
      </React.Fragment>
      </BrowserRouter>
    );
  }
}

export default App;
